import "./App.css"
import React from "react";
import ResponsiveAppBar from "./Components/NavBar";
import FrontPageAnimation from "./Components/StartUpAnimation/FrontPageAnimation";
import ActionAreaCard from "./Components/Card/CardComponent";
function App() {
  return <div>
    <FrontPageAnimation />
    <ResponsiveAppBar />
    <div style={{ backgroundColor:grey }} >
      <ActionAreaCard toDisplay="My Projects" toDescribe="All i have done is nothing" todo="projects" />
      <ActionAreaCard toDisplay="My Hobbies" toDescribe="All i have done is nothing" todo="hobby" />
      <ActionAreaCard toDisplay="My Achievements" toDescribe="All i have done is nothing" todo="achieve" />
    </div>
  </div>
}

export default App;
